--
-- Name: add_business_type(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.add_business_type(type_name text) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    new_id UUID;
BEGIN
    INSERT INTO business_types (type_name, created_by)
    VALUES (type_name, auth.uid())
    ON CONFLICT (type_name) DO NOTHING
    RETURNING id INTO new_id;
    
    -- If conflict occurred, get existing id
    IF new_id IS NULL THEN
        SELECT id INTO new_id FROM business_types WHERE business_types.type_name = add_business_type.type_name;
    END IF;
    
    RETURN new_id;
END;
$$;


ALTER FUNCTION public.add_business_type(type_name text) OWNER TO postgres;

--
-- Name: convert_lead_to_client(uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.convert_lead_to_client(p_lead_id uuid) RETURNS uuid
    LANGUAGE plpgsql
    AS $$
DECLARE
  lead_record leads%ROWTYPE;
  new_client_id uuid;
BEGIN
  -- Get the lead record
  SELECT * INTO lead_record FROM leads WHERE lead_id = p_lead_id;
  
  IF NOT FOUND THEN
    RAISE EXCEPTION 'Lead not found with ID: %', p_lead_id;
  END IF;
  
  -- Create new client record
  INSERT INTO clients (
    restaurant_name,
    contact_name,
    phone,
    email,
    original_lead_id,
    client_status
  ) VALUES (
    lead_record.restaurant_name,
    lead_record.contact_name,
    lead_record.phone,
    lead_record.email,
    p_lead_id,
    'פעיל'
  ) RETURNING client_id INTO new_client_id;
  
  -- Update lead status and link to client
  UPDATE leads 
  SET 
    lead_status = 'הפך ללקוח',
    client_id = new_client_id,
    updated_at = now()
  WHERE lead_id = p_lead_id;
  
  -- Log the activity
  INSERT INTO lead_activity_log (lead_id, activity_description)
  VALUES (p_lead_id, 'הליד הומר ללקוח');
  
  RETURN new_client_id;
END;
$$;


ALTER FUNCTION public.convert_lead_to_client(p_lead_id uuid) OWNER TO postgres;

--
-- Name: decrement_client_servings(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.decrement_client_servings() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
  -- Only decrement if client_id is not NULL
  IF NEW.client_id IS NOT NULL THEN
    -- Check if client has enough servings
    IF (SELECT remaining_servings FROM public.clients WHERE client_id = NEW.client_id) > 0 THEN
      -- Decrement the remaining_servings
      UPDATE public.clients
      SET remaining_servings = remaining_servings - 1,
          last_activity_at = now()
      WHERE client_id = NEW.client_id;
    ELSE
      -- If no servings are left, raise an exception
      RAISE EXCEPTION 'Not enough remaining servings for client %', NEW.client_id;
    END IF;
  END IF;
  -- For NULL client_id (public submissions), don't decrement anything
  
  RETURN NEW;
END;
$$;


