--
-- Name: get_user_auth_data(uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_user_auth_data(user_uid uuid) RETURNS TABLE(user_role text, client_id uuid, restaurant_name text, has_client_record boolean)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_user_role TEXT;
    v_client_id UUID;
    v_restaurant_name TEXT;
BEGIN
    -- First check if user has an explicit role (admin/editor) from public.user_roles
    SELECT ur.role INTO v_user_role
    FROM public.user_roles ur
    WHERE ur.user_id = user_uid
    LIMIT 1;
    
    IF v_user_role IS NOT NULL THEN
        -- User has an explicit role (staff), return it
        RETURN QUERY SELECT 
            v_user_role,
            NULL::uuid, -- No client_id for staff
            NULL::text, -- No restaurant_name for staff
            false;      -- Staff don't have a linked client record in this context
        RETURN;
    END IF;
    
    -- If no explicit role, check for a client record (implies customer role)
    SELECT c.client_id, c.restaurant_name
    INTO v_client_id, v_restaurant_name
    FROM public.clients c
    WHERE c.user_auth_id = user_uid
    LIMIT 1;
    
    IF v_client_id IS NOT NULL THEN
        -- Client record found, user is a customer
        RETURN QUERY SELECT 
            'customer'::text, -- Assign 'customer' role
            v_client_id,
            v_restaurant_name,
            true;             -- Customer has a linked client record
        RETURN;
    END IF;
    
    -- User has no explicit role and no client record
    RETURN QUERY SELECT 
        NULL::text,          -- No role determined
        NULL::uuid,
        NULL::text,
        false;
END;
$$;


ALTER FUNCTION public.get_user_auth_data(user_uid uuid) OWNER TO postgres;

