--
-- Name: public_submit_item_by_restaurant_name(text, text, text, text, text, text, text, text, text[], text[]); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.public_submit_item_by_restaurant_name(p_restaurant_name text, p_item_type text, p_item_name text, p_contact_name text, p_contact_phone text, p_contact_email text, p_description text DEFAULT NULL::text, p_category text DEFAULT NULL::text, p_ingredients text[] DEFAULT NULL::text[], p_reference_image_urls text[] DEFAULT '{}'::text[]) RETURNS json
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_lead_id UUID;
    v_client_id UUID;
    v_item_id UUID;
    v_submission_id UUID;
    v_result json;
    v_new_lead_status lead_status_type := 'ליד חדש'; -- CORRECTED to Hebrew value
    v_new_lead_source lead_source_type := 'אתר';     -- CORRECTED to Hebrew value
BEGIN
    RAISE LOG 'Entering comprehensive public_submit_item_by_restaurant_name (10 params with lead creation) for restaurant: %', p_restaurant_name;

    SELECT client_id INTO v_client_id
    FROM public.clients
    WHERE LOWER(TRIM(restaurant_name)) = LOWER(TRIM(p_restaurant_name))
       OR (p_contact_email IS NOT NULL AND lower(email) = lower(p_contact_email))
    LIMIT 1;

    IF v_client_id IS NULL THEN
        SELECT lead_id INTO v_lead_id
        FROM public.leads
        WHERE LOWER(TRIM(restaurant_name)) = LOWER(TRIM(p_restaurant_name))
           OR (p_contact_email IS NOT NULL AND lower(email) = lower(p_contact_email))
           OR (p_contact_phone IS NOT NULL AND phone = p_contact_phone)
        LIMIT 1;
    END IF;

    IF v_client_id IS NULL AND v_lead_id IS NULL THEN
        RAISE LOG 'No existing client or lead found. Creating new lead for restaurant: %, phone: %', p_restaurant_name, p_contact_phone;
        INSERT INTO public.leads (
            restaurant_name,
            contact_name,
            phone,
            email,
            lead_status,
            lead_source, 
            next_follow_up_date
        ) VALUES (
            p_restaurant_name,
            p_contact_name,
            p_contact_phone,
            p_contact_email,
            v_new_lead_status,
            v_new_lead_source,
            NOW() + INTERVAL '24 hours'
        ) RETURNING leads.lead_id INTO v_lead_id;
        RAISE LOG 'New lead created with ID: %', v_lead_id;
    ELSIF v_client_id IS NOT NULL THEN
         RAISE LOG 'Existing client found: % No new lead created.', v_client_id;
    ELSIF v_lead_id IS NOT NULL THEN
         RAISE LOG 'Existing lead found: % No new lead created.', v_lead_id;
    END IF;

    IF p_item_type = 'dish' THEN
        INSERT INTO public.dishes (client_id, name, description, category, reference_image_urls)
        VALUES (v_client_id, p_item_name, p_description, p_category, p_reference_image_urls)
        RETURNING dishes.dish_id INTO v_item_id;
    ELSIF p_item_type = 'cocktail' THEN
        INSERT INTO public.cocktails (client_id, name, description, ingredients_array, reference_image_urls)
        VALUES (v_client_id, p_item_name, p_description, p_ingredients, p_reference_image_urls)
        RETURNING cocktails.cocktail_id INTO v_item_id;
    ELSIF p_item_type = 'drink' THEN
        INSERT INTO public.drinks (client_id, name, description, category, reference_image_urls)
        VALUES (v_client_id, p_item_name, p_description, p_category, p_reference_image_urls)
        RETURNING drinks.drink_id INTO v_item_id;
    END IF;
    RAISE LOG 'Item created with ID: % for client_id: %', v_item_id, v_client_id;

    INSERT INTO public.customer_submissions (client_id, original_item_id, item_type, item_name_at_submission, submission_status, original_image_urls)
    VALUES (v_client_id, v_item_id, p_item_type, p_item_name, 'ממתינה לעיבוד', p_reference_image_urls)
    RETURNING customer_submissions.submission_id INTO v_submission_id;
    RAISE LOG 'Submission created with ID: %', v_submission_id;

    v_result := json_build_object(
        'success', true,
        'submission_id', v_submission_id,
        'item_id', v_item_id,
        'lead_id', v_lead_id, 
        'client_id', v_client_id, 
        'message', CASE 
            WHEN v_lead_id IS NOT NULL AND v_client_id IS NULL AND NOT EXISTS(SELECT 1 FROM public.clients cl WHERE cl.email = p_contact_email OR cl.phone = p_contact_phone) THEN 'ליד חדש נוצר והפריט נוסף בהצלחה.'
            WHEN v_client_id IS NOT NULL THEN 'הפריט נוסף בהצלחה ושויך למסעדה קיימת.'
            WHEN v_lead_id IS NOT NULL THEN 'ליד קיים נמצא, הפריט נוסף בהצלחה.'
            ELSE 'הפריט נוסף בהצלחה אך לא שויך לליד או לקוח קיים.' 
        END
    );
    RETURN v_result;
EXCEPTION
    WHEN OTHERS THEN
        RAISE WARNING '[public_submit_item_by_restaurant_name] Exception: %', SQLERRM;
        RAISE WARNING '[public_submit_item_by_restaurant_name] SQLSTATE: %', SQLSTATE;
        RETURN json_build_object('success', false, 'message', SQLERRM);
END;
$$;


