    ai_training_cost_per_unit numeric(10,2) DEFAULT 1.50,
    ai_prompts_count integer DEFAULT 0 NOT NULL,
    ai_prompt_cost_per_unit numeric(10,2) DEFAULT 0.16,
    revenue_from_lead_local numeric(10,2) DEFAULT 0.00,
    exchange_rate_at_conversion numeric(10,4),
    revenue_from_lead_usd numeric(10,2) GENERATED ALWAYS AS (
CASE
    WHEN ((exchange_rate_at_conversion IS NOT NULL) AND (exchange_rate_at_conversion > (0)::numeric)) THEN (revenue_from_lead_local / exchange_rate_at_conversion)
    ELSE NULL::numeric
END) STORED,
    roi numeric(10,2) GENERATED ALWAYS AS (
CASE
    WHEN (((((ai_trainings_count)::numeric * ai_training_cost_per_unit) + ((ai_prompts_count)::numeric * ai_prompt_cost_per_unit)) > (0)::numeric) AND (
    CASE
        WHEN ((exchange_rate_at_conversion IS NOT NULL) AND (exchange_rate_at_conversion > (0)::numeric)) THEN (revenue_from_lead_local / exchange_rate_at_conversion)
        ELSE NULL::numeric
    END IS NOT NULL) AND ((((ai_trainings_count)::numeric * ai_training_cost_per_unit) + ((ai_prompts_count)::numeric * ai_prompt_cost_per_unit)) <> (0)::numeric)) THEN (((
    CASE
        WHEN ((exchange_rate_at_conversion IS NOT NULL) AND (exchange_rate_at_conversion > (0)::numeric)) THEN (revenue_from_lead_local / exchange_rate_at_conversion)
        ELSE NULL::numeric
    END - (((ai_trainings_count)::numeric * ai_training_cost_per_unit) + ((ai_prompts_count)::numeric * ai_prompt_cost_per_unit))) / (((ai_trainings_count)::numeric * ai_training_cost_per_unit) + ((ai_prompts_count)::numeric * ai_prompt_cost_per_unit))) * (100)::numeric)
    ELSE NULL::numeric
END) STORED,
    client_id uuid,
    business_type text DEFAULT 'מסעדה'::text,
    is_archived boolean DEFAULT false,
    lora_page_url text,
    style_description text,
    custom_prompt text,
    reminder_notes text,
    conversion_reason text,
    rejection_reason text,
    ai_training_25_count integer DEFAULT 0,
    ai_training_15_count integer DEFAULT 0,
    ai_training_5_count integer DEFAULT 0,
    total_ai_costs numeric GENERATED ALWAYS AS ((((((ai_training_25_count)::numeric * 2.5) + ((ai_training_15_count)::numeric * 1.5)) + ((ai_training_5_count)::numeric * 5.0)) + ((ai_prompts_count)::numeric * ai_prompt_cost_per_unit))) STORED,
    archived_at timestamp with time zone
);


