20240320000000	{"-- Enable RLS on tables\nALTER TABLE public.clients ENABLE ROW LEVEL SECURITY","ALTER TABLE public.customer_submissions ENABLE ROW LEVEL SECURITY","ALTER TABLE public.leads ENABLE ROW LEVEL SECURITY","ALTER TABLE public.service_packages ENABLE ROW LEVEL SECURITY","-- Policies for clients table\nCREATE POLICY \\"Admins have full access to clients\\"\nON public.clients\nFOR ALL\nTO authenticated\nUSING (auth.jwt()->>'role' = 'admin')","CREATE POLICY \\"Customers can view and update their own client record\\"\nON public.clients\nFOR SELECT\nTO authenticated\nUSING (auth.uid() = user_auth_id)","CREATE POLICY \\"Customers can update their own contact details\\"\nON public.clients\nFOR UPDATE\nTO authenticated\nUSING (auth.uid() = user_auth_id)\nWITH CHECK (auth.uid() = user_auth_id)","-- Policies for customer_submissions table\nCREATE POLICY \\"Admins have full access to submissions\\"\nON public.customer_submissions\nFOR ALL\nTO authenticated\nUSING (auth.jwt()->>'role' = 'admin')","CREATE POLICY \\"Editors can access assigned submissions\\"\nON public.customer_submissions\nFOR ALL\nTO authenticated\nUSING (\n  assigned_editor_id = auth.uid() OR\n  auth.jwt()->>'role' = 'editor'\n)","CREATE POLICY \\"Customers can view their own submissions\\"\nON public.customer_submissions\nFOR SELECT\nTO authenticated\nUSING (\n  client_id IN (\n    SELECT client_id \n    FROM public.clients \n    WHERE user_auth_id = auth.uid()\n  )\n)","CREATE POLICY \\"Customers can create new submissions\\"\nON public.customer_submissions\nFOR INSERT\nTO authenticated\nWITH CHECK (\n  client_id IN (\n    SELECT client_id \n    FROM public.clients \n    WHERE user_auth_id = auth.uid()\n  )\n)","CREATE POLICY \\"Customers can update submission feedback and approval\\"\nON public.customer_submissions\nFOR UPDATE\nTO authenticated\nUSING (\n  client_id IN (\n    SELECT client_id \n    FROM public.clients \n    WHERE user_auth_id = auth.uid()\n  )\n)\nWITH CHECK (\n  client_id IN (\n    SELECT client_id \n    FROM public.clients \n    WHERE user_auth_id = auth.uid()\n  )\n)","-- Policies for leads table\nCREATE POLICY \\"Admins have full access to leads\\"\nON public.leads\nFOR ALL\nTO authenticated\nUSING (auth.jwt()->>'role' = 'admin')","CREATE POLICY \\"Anyone can create a lead\\"\nON public.leads\nFOR INSERT\nTO anon, authenticated\nWITH CHECK (true)","-- Policies for service_packages table\nCREATE POLICY \\"Anyone can view active packages\\"\nON public.service_packages\nFOR SELECT\nTO anon, authenticated\nUSING (is_active = true)","CREATE POLICY \\"Admins can manage packages\\"\nON public.service_packages\nFOR ALL\nTO authenticated\nUSING (auth.jwt()->>'role' = 'admin')"}	customer_auth_rls	\N	\N
