ublic\\".\\"notifications\\" add constraint \\"notifications_user_id_fkey\\" FOREIGN KEY (user_id) REFERENCES auth.users(id) not valid","alter table \\"public\\".\\"notifications\\" validate constraint \\"notifications_user_id_fkey\\"","alter table \\"public\\".\\"service_packages\\" add constraint \\"service_packages_package_name_key\\" UNIQUE using index \\"service_packages_package_name_key\\"","alter table \\"public\\".\\"user_roles\\" add constraint \\"user_roles_user_id_fkey\\" FOREIGN KEY (user_id) REFERENCES auth.users(id) ON DELETE CASCADE not valid","alter table \\"public\\".\\"user_roles\\" validate constraint \\"user_roles_user_id_fkey\\"","alter table \\"public\\".\\"user_roles\\" add constraint \\"user_roles_user_id_role_key\\" UNIQUE using index \\"user_roles_user_id_role_key\\"","alter table \\"public\\".\\"user_roles\\" add constraint \\"user_roles_user_id_unique\\" UNIQUE using index \\"user_roles_user_id_unique\\"","alter table \\"public\\".\\"clients\\" add constraint \\"clients_current_package_id_fkey\\" FOREIGN KEY (current_package_id) REFERENCES service_packages(package_id) ON UPDATE CASCADE ON DELETE SET NULL DEFERRABLE INITIALLY DEFERRED not valid","alter table \\"public\\".\\"clients\\" validate constraint \\"clients_current_package_id_fkey\\"","set check_function_bodies = off","CREATE OR REPLACE FUNCTION public.decrement_client_servings()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n  -- Check if client has enough servings\n  IF (SELECT remaining_servings FROM public.clients WHERE client_id = NEW.client_id) > 0 THEN\n    -- Decrement the remaining_servings\n    UPDATE public.clients\n    SET remaining_servings = remaining_servings - 1,\n        last_activity_at = now()\n    WHERE client_id = NEW.client_id;\n  ELSE\n    -- If no servings are left, raise an exception\n    RAISE EXCEPTION 'Not enough remaining servings for client %', NEW.client_id;\n  END IF;\n  \n  RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.get_client_for_user(user_auth_id uuid)\n RETURNS uuid\n LANGUAGE sql\n STABLE SECURITY DEFINER\n SET search_path TO 'public'\nAS $function$\n  SELECT client_id FROM clients WHERE user_auth_id = get_client_for_user.user_auth_id LIMIT 1;\n$function$","CREATE OR REPLACE FUNCTION public.get_client_id(p_user_id uuid)\n RETURNS uuid\n LANGUAGE sql\n SECURITY DEFINER\n SET search_path TO 'public'\nAS $function$\n  SELECT client_id FROM clients WHERE user_auth_id = p_user_id LIMIT 1;\n$function$","CREATE OR REPLACE FUNCTION public.get_user_auth_data(user_uid uuid)\n RETURNS TABLE(user_role text, client_id uuid, restaurant_name text, has_client_record boolean)\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path TO 'public'\nAS $function$\nBEGIN\n  -- First check if user has an explicit role (admin/editor)\n  SELECT role INTO user_role\n  FROM public.user_roles\n  WHERE user_id = user_uid\n  LIMIT 1;\n  \n  -- If user has an explicit role, they're staff (no client record)\n  IF user_role IS NOT NULL THEN\n    RETURN QUERY SELECT \n      user_role,\n      NULL::uuid as client_id,\n      NULL::text as restaurant_name,\n      false as has_client_record;\n    RETURN;\n  END IF;\n  \n  -- Check for client record (customer role)\n  SELECT c.client_id, c.restaurant_name\n  INTO client_id, restaurant_name\n  FROM public.clients c\n  WHERE c.user_auth_id = user_uid\n  LIMIT 1;\n  \n  -- If client record exists, user is a customer\n  IF client_id IS NOT NULL THEN\n    RETURN QUERY SELECT \n      'customer'::text as user_role,\n      client_id,\n      restaurant_name,\n      true as has_client_record;\n    RETURN;\n  END IF;\n  \n  -- User has no role and no client record\n  RETURN QUERY SELECT \n    NULL::text as user_role,\n    NULL::uuid as client_id,\n    NULL::text as restaurant_name,\n    false as has_client_record;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.get_user_client_id(user_uid uuid)\n RETURNS text\n LANGUAGE plpgsql\n SECURITY DEFINER\nAS $function$\nDECLARE\n  _client_id TEXT;\nBEGIN\n  -- ASSUMPTION: The 'clients' table has a 'user_auth_id' column\n  -- that links to the 'id' from the 'auth.users' table.\n  -- If your column is named differently (e.g., auth_user_id, user_id),\n  -- please adjust the 'user_auth_id' in the SELECT query below.\n  SELECT client_id INTO _client_id\n  FROM public.clients\n  WHERE user_auth_id = user_uid; -- Ensure this column name is correct!\n  \n  RETURN _client_id;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.has_role(user_id uuid, role_name text)\n RETURNS boolean\n LANGUAGE plpgsql\n SECURITY DEFINER\nAS $function$BEGIN\n  RETURN EXISTS (\n    SELECT 1 FROM public.user_roles\n    WHERE public.user_roles.user_id = $1 AND role = $2\n  );\nEND;$function$","CREATE OR REPLACE FUNCTION public.is_account_manager()\n RETURNS boolean\n LANGUAGE sql\n SECURITY DEFINER\nAS $function$\n  SELECT EXISTS (\n    SELECT 1 FROM public.user_roles\n    WHERE user_id = auth.uid() AND role = 'account_manager'\n  );\n$function$","CREATE OR REPLACE FUNCTION public.is_admin_or_account_manager()\n RETURNS boolean\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path TO 'public', 'extensions', 'pg_catalog'\nAS $function$\nDECLARE\n  user_role_value TEXT;\nBEGIN\n  -- Get the role of the current user\n  SELECT public.get_my_role() INTO user_role_value;\n\n  -- Check if the role is 'admin' or 'account_manager'\n  RETURN user_role_value = 'admin' OR user_role_value = 'account_manager';\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.is_client_owner(client_id uuid)\n RETURNS boolean\n LANGUAGE sql\n STABLE SECURITY DEFINER\n SET search_path TO 'public'\nAS $function$\n  SELECT EXISTS(\n    SELECT 1 FROM clients \n    WHERE clients.client_id = is_client_owner.client_id \n    AND clients.user_auth_id = auth.uid()\n  );\n$function$","CREATE OR REPLACE FUNCTION public.trigger_set_updated_at()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n  NEW.updated_at = timezone('utc'::text, now());\n  RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_client_activity_timestamp()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n   NEW.last_activity_at = now();\n   RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_lead_modified_column()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n   NEW.last_updated_at = now();\n   RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.update_package_timestamp()\n RETURNS trigger\n LANGUAGE plpgsql\nAS $function$\nBEGIN\n  NEW.updated_at = now();\n  RETURN NEW;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.get_my_role()\n RETURNS text\n LANGUAGE plpgsql\n SECURITY DEFINER\n SET search_path TO 'public', 'extensions', 'pg_catalog'\nAS $function$\nDECLARE\n  user_role_value TEXT;\nBEGIN\n  SELECT role\n  INTO user_role_value\n  FROM public.user_roles\n  WHERE user_id = auth.uid();\n\n  RETURN user_role_value;\nEND;\n$function$","CREATE OR REPLACE FUNCTION public.is_admin()\n RETURNS boolean\n LANGUAGE sql\n SECURITY DEFINER\nAS $function$\n  SELECT EXISTS (\n    SELECT 1 FROM public.user_roles\n    WHERE user_id = auth.uid() AND role = 'admin'\n  );\n$function$","CREATE OR REPLACE FUNCTION public.is_editor()\n RETURNS boolean\n LANGUAGE sql\n SECURITY DEFINER\nAS $function$\n  SELECT EXISTS (\n    SELECT 1 FROM public.user_roles\n    WHERE user_id = auth.uid() AND role = 'editor'\n  );\n$function$","grant delete on table \\"public\\".\\"additional_details\\" to \\"anon\\"","grant insert on table \\"public\\".\\"additional_details\\" to \\"anon\\"","grant references on table \\"public\\".\\"additional_details\\" to \\"anon\\"","grant select on table \\"public\\".\\"additional_details\\" to \\"anon\\"","grant trigger on table \\"public\\".\\"additional_details\\" to \\"anon\\"","grant truncate on table \\"public\\".\\"additional_details\\" to \\"anon\\"","grant update on table \\"public\\".\\"additional_details\\" to \\"anon\\"","grant delete