20250526041944	{"-- First, create the missing tables if they don't exist\nCREATE TABLE IF NOT EXISTS public.dishes (\n    id uuid DEFAULT gen_random_uuid() PRIMARY KEY,\n    client_id uuid REFERENCES public.clients(client_id),\n    name text NOT NULL,\n    description text,\n    category text,\n    price decimal(10,2),\n    image_urls text[],\n    is_active boolean DEFAULT true,\n    created_at timestamp with time zone DEFAULT timezone('utc'::text, now()) NOT NULL,\n    updated_at timestamp with time zone DEFAULT timezone('utc'::text, now()) NOT NULL\n);\n\nCREATE TABLE IF NOT EXISTS public.cocktails (\n    id uuid DEFAULT gen_random_uuid() PRIMARY KEY,\n    client_id uuid REFERENCES public.clients(client_id),\n    name text NOT NULL,\n    description text,\n    ingredients text[],\n    price decimal(10,2),\n    image_urls text[],\n    is_active boolean DEFAULT true,\n    created_at timestamp with time zone DEFAULT timezone('utc'::text, now()) NOT NULL,\n    updated_at timestamp with time zone DEFAULT timezone('utc'::text, now()) NOT NULL\n);\n\nCREATE TABLE IF NOT EXISTS public.drinks (\n    id uuid DEFAULT gen_random_uuid() PRIMARY KEY,\n    client_id uuid REFERENCES public.clients(client_id),\n    name text NOT NULL,\n    description text,\n    category text,\n    price decimal(10,2),\n    image_urls text[],\n    is_active boolean DEFAULT true,\n    created_at timestamp with time zone DEFAULT timezone('utc'::text, now()) NOT NULL,\n    updated_at timestamp with time zone DEFAULT timezone('utc'::text, now()) NOT NULL\n);\n\n-- Allow NULL values in client_id for customer_submissions\nALTER TABLE public.customer_submissions \nALTER COLUMN client_id DROP NOT NULL;\n\n-- Create the public submission function\nCREATE OR REPLACE FUNCTION public.public_submit_item_by_restaurant_name(\n    p_restaurant_name text,\n    p_item_type text,\n    p_item_name text,\n    p_description text DEFAULT NULL,\n    p_category text DEFAULT NULL,\n    p_ingredients text[] DEFAULT NULL,\n    p_price decimal DEFAULT NULL,\n    p_reference_image_urls text[] DEFAULT NULL\n)\nRETURNS json\nLANGUAGE plpgsql\nSECURITY DEFINER\nAS $$\nDECLARE\n    v_client_id uuid;\n    v_submission_id uuid;\n    v_item_id uuid;\n    v_result json;\nBEGIN\n    -- Validate item type\n    IF p_item_type NOT IN ('dish', 'cocktail', 'drink') THEN\n        RAISE EXCEPTION 'Invalid item type. Must be dish, cocktail, or drink';\n    END IF;\n\n    -- Try to find the client by restaurant name\n    SELECT client_id INTO v_client_id\n    FROM public.clients\n    WHERE LOWER(TRIM(restaurant_name)) = LOWER(TRIM(p_restaurant_name))\n    LIMIT 1;\n\n    -- Create submission record (with or without client_id)\n    INSERT INTO public.customer_submissions (\n        client_id,\n        item_type,\n        item_name_at_submission,\n        submission_status,\n        original_image_urls\n    ) VALUES (\n        v_client_id, -- Can be NULL\n        p_item_type,\n        p_item_name,\n        'ממתינה לעיבוד',\n        p_reference_image_urls\n    ) RETURNING submission_id INTO v_submission_id;\n\n    -- Create the actual item in the appropriate table\n    IF p_item_type = 'dish' THEN\n        INSERT INTO public.dishes (\n            client_id,\n            name,\n            description,\n            category,\n            price,\n            image_urls\n        ) VALUES (\n            v_client_id,\n            p_item_name,\n            p_description,\n            p_category,\n            p_price,\n            p_reference_image_urls\n        ) RETURNING id INTO v_item_id;\n    ELSIF p_item_type = 'cocktail' THEN\n        INSERT INTO public.cocktails (\n            client_id,\n            name,\n            description,\n            ingredients,\n            price,\n            image_urls\n        ) VALUES (\n            v_client_id,\n            p_item_name,\n            p_description,\n            p_ingredients,\n            p_price,\n            p_reference_image_urls\n        ) RETURNING id INTO v_item_id;\n    ELSIF p_item_type = 'drink' THEN\n        INSERT INTO public.drinks (\n            client_id,\n            name,\n            description,\n            category,\n            price,\n            image_urls\n        ) VALUES (\n            v_client_id,\n            p_item_name,\n            p_description,\n            p_category,\n            p_price,\n            p_reference_image_urls\n        ) RETURNING id INTO v_item_id;\n    END IF;\n\n    -- Return result\n    v_result := json_build_object(\n        'success', true,\n        'submission_id', v_submission_id,\n        'item_id', v_item_id,\n        'client_found', v_client_id IS NOT NULL,\n        'client_id', v_client_id,\n        'message', CASE \n            WHEN v_client_id IS NOT NULL THEN \n                'הפריט נוסף בהצלחה ושויך למסעדה'\n            ELSE \n                'הפריט נוסף בהצלחה. המסעדה לא נמצאה במערכת, הפריט ממתין לשיוך ידני'\n        END\n    );\n\n    RETURN v_result;\nEND;\n$$;\n\n-- Grant execute permission on the function to anon and authenticated\nGRANT EXECUTE ON FUNCTION public.public_submit_item_by_restaurant_name TO anon, authenticated;\n\n-- Create RLS policies for the new tables\nALTER TABLE public.dishes ENABLE ROW LEVEL SECURITY;\nALTER TABLE public.cocktails ENABLE ROW LEVEL SECURITY;\nALTER TABLE public.drinks ENABLE ROW LEVEL SECURITY;\n\n-- Allow anon/authenticated to insert into these tables via the function\nCREATE POLICY \\"Enable insert for public submission\\" ON public.dishes\n    FOR INSERT TO anon, authenticated\n    WITH CHECK (true);\n\nCREATE POLICY \\"Enable insert for public submission\\" ON public.cocktails\n    FOR INSERT TO anon, authenticated\n    WITH CHECK (true);\n\nCREATE POLICY \\"Enable insert for public submission\\" ON public.drinks\n    FOR INSERT TO anon, authenticated\n    WITH CHECK (true);"}	create_public_submission_function	avi@ai-master.co.il	\N
20250530055713	{"\n-- Add columns to track public submissions that created leads\nALTER TABLE public.customer_submissions \nADD COLUMN created_lead_id uuid REFERENCES public.leads(id),\nADD COLUMN submission_contact_email text,\nADD COLUMN submission_contact_phone text,\nADD COLUMN submission_contact_name text;\n\n-- Create index for better performance when looking up submissions by lead\nCREATE INDEX idx_customer_submissions_created_lead_id \nON public.customer_submissions(created_lead_id);\n\n-- Update the public submission function to create leads when restaurant not found\nCREATE OR REPLACE FUNCTION public.public_submit_item_by_restaurant_name(\n    p_restaurant_name text, \n    p_item_type text, \n    p_item_name text, \n    p_description text DEFAULT NULL::text, \n    p_category text DEFAULT NULL::text, \n    p_ingredients text[] DEFAULT NULL::text[], \n    p_reference_image_urls text[] DEFAULT '{}'::text[],\n    p_contact_email text DEFAULT NULL::text,\n    p_contact_phone text DEFAULT NULL::text,\n    p_contact_name text DEFAULT NULL::text\n)\nRETURNS json\nLANGUAGE plpgsql\nSECURITY DEFINER\nAS $function$\nDECLARE\n    v_client_id uuid;\n    v_submission_id uuid;\n    v_item_id uuid;\n    v_lead_id uuid;\n    v_result json;\n    v_client_has_servings boolean := false;\nBEGIN\n    -- Validate item type\n    IF p_item_type NOT IN ('dish', 'cocktail', 'drink') THEN\n        RAISE EXCEPTION 'Invalid item type. Must be dish, cocktail, or drink';\n    END IF;\n\n    -- Try to find the client by restaurant name (case insensitive, trimmed)\n    SELECT client_id INTO v_client_id\n    FROM public.clients\n    WHERE LOWER(TRIM(restaurant_name)) = LOWER(TRIM(p_restaurant_name))\n    LIMIT 1;\n\n    -- If client exists, check if they have remaining servings\n    IF v_client_id IS NOT NULL THEN\n        SELECT remaining_servings > 0 INTO v_client_has_servings\n        FROM public.clients\n        WHERE client_id = v_client_id;\n        \n        -- If client exists but has no servings, raise an error\n        IF NOT v_client_has_servings THEN\n            RAISE EXCEPTION 'Not enough remaining servings for client %', v_client_id;\n        END IF;\n    ELSE\n        -- Client not found - create a lead if we have contact information\n        IF p_contact_email IS NOT NULL OR p_contact_phone IS NOT NULL THEN\n            INSERT INTO public.leads (\n                restaurant_name,\n                contact_name,\n                email,\n                phone_number,\n                lead_status,\n                lead_source,\n                notes\n            ) VALUES (\n                p_restaurant_name,\n                COALESCE(p_contact_name, 'לא סופק'),\n                COALESCE(p_contact_email, 'לא סופק'),\n                COALESCE(p_contact_phone, 'לא סופק'),\n                'ליד חדש',\n                'אתר',\n                'נוצר אוטומטית מהגשה ציבורית של פריט: ' || p_item_name\n            ) RETURNING id INTO v_lead_id;\n        END IF;\n    END IF;\n\n    -- Create the actual item in the appropriate table first\n    IF p_item_type = 'dish' THEN\n        INSERT INTO public.dishes (\n            client_id,\n            name,\n            description,\n            category,\n            reference_image_urls\n        ) VALUES (\n            v_client_id,\n            p_item_name,\n            p_description,\n            p_category,\n            p_reference_image_urls\n        ) RETURNING dish_id INTO v_item_id;\n        \n    ELSIF p_item_type = 'cocktail' THEN\n        INSERT INTO public.cocktails (\n            client_id,\n            name,\n            description,\n            ingredients_array,\n            reference_image_urls\n        ) VALUES (\n            v_client_id,\n            p_item_name,\n            p_description,\n            p_ingredients,\n            p_reference_image_urls\n        ) RETURNING cocktail_id INTO v_item_id;\n        \n    ELSIF p_item_type = 'drink' THEN\n        INSERT INTO public.drinks (\n            client_id,\n            name,\n            description,\n            category,\n            reference_image_urls\n        ) VALUES (\n            v_client_id,\n            p_item_name,\n            p_description,\n            p_category,\n            p_reference_image_urls\n        ) RETURNING drink_id INTO v_item_id;\n    END IF;\n\n    -- Create submission record\n    INSERT INTO public.customer_submissions (\n        client_id,\n        original_item_id,\n        item_type,\n        item_name_at_submission,\n        submission_status,\n        original_image_urls,\n        created_lead_id,\n        submission_contact_email,\n        submission_contact_phone,\n        submission_contact_name\n    ) VALUES (\n        v_client_id,\n        v_item_id,\n        p_item_type,\n        p_item_name,\n        'ממתינה לעיבוד',\n        p_reference_image_urls,\n        v_lead_id,\n        p_contact_email,\n        p_contact_phone,\n        p_contact_name\n    ) RETURNING submission_id INTO v_submission_id;\n\n    -- Only decrement servings if client exists and has servings\n    IF v_client_id IS NOT NULL AND v_client_has_servings THEN\n        UPDATE public.clients\n        SET remaining_servings = remaining_servings - 1,\n            last_activity_at = now()\n        WHERE client_id = v_client_id;\n    END IF;\n\n    -- Return result in expected format\n    v_result := json_build_object(\n        'success', true,\n        'submission_id', v_submission_id,\n        'item_id', v_item_id,\n        'client_found', v_client_id IS NOT NULL,\n        'client_id', v_client_id,\n        'lead_created', v_lead_id IS NOT NULL,\n        'lead_id', v_lead_id,\n        'message', CASE \n            WHEN v_client_id IS NOT NULL THEN \n                'הפריט נוסף בהצלחה ושויך למסעדה'\n            WHEN v_lead_id IS NOT NULL THEN\n                'הפריט נוסף בהצלחה. נוצר ליד חדש למסעדה'\n            ELSE \n                'הפריט נוסף בהצלחה. המסעדה לא נמצאה במערכת, הפריט ממתין לשיוך ידני'\n        END\n    );\n\n    RETURN v_result;\nEND;\n$function$\n"}	a0747912-5a6b-43ee-8cb4-61429ccacc4b	avi@ai-master.co.il	\N
20250531085545	{"-- Ensure idempotency for renames if run partially before\nDO $$\nBEGIN\n    IF EXISTS(SELECT 1 FROM information_schema.columns WHERE table_schema = 'public' AND table_name = 'leads' AND column_name = 'id') THEN\n        ALTER TABLE public.leads RENAME COLUMN id TO lead_id;\n    END IF;\n    IF EXISTS(SELECT 1 FROM information_schema.columns WHERE table_schema = 'public' AND table_name = 'leads' AND column_name = 'phone_number') THEN\n        ALTER TABLE public.leads RENAME COLUMN phone_number TO phone;\n    END IF;\n    IF EXISTS(SELECT 1 FROM information_schema.columns WHERE table_schema = 'public' AND table_name = 'leads' AND column_name = 'last_updated_at') THEN\n        ALTER TABLE public.leads RENAME COLUMN last_updated_at TO updated_at;\n    END IF;\n    IF EXISTS(SELECT 1 FROM information_schema.columns WHERE table_schema = 'public' AND table_name = 'leads' AND column_name = 'reminder_at') THEN\n        ALTER TABLE public.leads RENAME COLUMN reminder_at TO next_follow_up_date;\n    END IF;\n    IF EXISTS(SELECT 1 FROM information_schema.columns WHERE table_schema = 'public' AND table_name = 'leads' AND column_name = 'reminder_details') THEN\n        ALTER TABLE public.leads RENAME COLUMN reminder_details TO next_follow_up_notes;\n    END IF;\nEND $$;\n\n-- Drop columns if they exist from a previous failed attempt to ensure clean additions\nALTER TABLE public.leads\nDROP COLUMN IF EXISTS website_url,\nDROP COLUMN IF EXISTS address,\nDROP COLUMN IF EXISTS ai_trainings_count,\nDROP COLUMN IF EXISTS ai_training_cost_per_unit,\nDROP COLUMN IF EXISTS ai_prompts_count,\nDROP COLUMN IF EXISTS ai_prompt_cost_per_unit,\nDROP COLUMN IF EXISTS revenue_from_lead_local,\nDROP COLUMN IF EXISTS exchange_rate_at_conversion,\nDROP COLUMN IF EXISTS total_ai_costs, -- Will be re-added as generated\nDROP COLUMN IF EXISTS revenue_from_lead_usd, -- Will be re-added as generated\nDROP COLUMN IF EXISTS roi, -- Will be re-added as generated\nDROP COLUMN IF EXISTS client_id; -- Constraint will be dropped automatically if column is dropped\n\n-- Add new columns\nALTER TABLE public.leads\nADD COLUMN website_url TEXT NULL,\nADD COLUMN address TEXT NULL,\nADD COLUMN ai_trainings_count INTEGER NOT NULL DEFAULT 0,\nADD COLUMN ai_training_cost_per_unit NUMERIC(10, 2) DEFAULT 1.50,\nADD COLUMN ai_prompts_count INTEGER NOT NULL DEFAULT 0,\nADD COLUMN ai_prompt_cost_per_unit NUMERIC(10, 2) DEFAULT 0.16,\nADD COLUMN revenue_from_lead_local NUMERIC(10, 2) DEFAULT 0.00,\nADD COLUMN exchange_rate_at_conversion NUMERIC(10,4) NULL;\n\n-- Add generated columns (these must be defined after their dependent columns exist)\nALTER TABLE public.leads\nADD COLUMN total_ai_costs NUMERIC(10, 2) GENERATED ALWAYS AS ((ai_trainings_count * ai_training_cost_per_unit) + (ai_prompts_count * ai_prompt_cost_per_unit)) STORED,\nADD COLUMN revenue_from_lead_usd NUMERIC(10,2) GENERATED ALWAYS AS (\n    CASE\n        WHEN exchange_rate_at_conversion IS NOT NULL AND exchange_rate_at_conversion > 0\n        THEN revenue_from_lead_local / exchange_rate_at_conversion\n        ELSE NULL\n    END\n) STORED;\n\n-- Corrected ROI definition to not depend on another generated column directly in its expression source\nALTER TABLE public.leads\nADD COLUMN roi NUMERIC(10, 2) GENERATED ALWAYS AS (\n    CASE\n        WHEN ((ai_trainings_count * ai_training_cost_per_unit) + (ai_prompts_count * ai_prompt_cost_per_unit)) > 0 AND \n             (CASE WHEN exchange_rate_at_conversion IS NOT NULL AND exchange_rate_at_conversion > 0 THEN revenue_from_lead_local / exchange_rate_at_conversion ELSE NULL END) IS NOT NULL AND \n             ((ai_trainings_count * ai_training_cost_per_unit) + (ai_prompts_count * ai_prompt_cost_per_unit)) <> 0\n        THEN (( (CASE WHEN exchange_rate_at_conversion IS NOT NULL AND exchange_rate_at_conversion > 0 THEN revenue_from_lead_local / exchange_rate_at_conversion ELSE NULL END) - ((ai_trainings_count * ai_training_cost_per_unit) + (ai_prompts_count * ai_prompt_cost_per_unit)) ) / ((ai_trainings_count * ai_training_cost_per_unit) + (ai_prompts_count * ai_prompt_cost_per_unit))) * 100\n        ELSE NULL\n    END\n) STORED;\n\n-- Add foreign key to clients table\nALTER TABLE public.leads\nADD COLUMN client_id UUID NULL,\nADD CONSTRAINT fk_client\n    FOREIGN KEY(client_id)\n    REFERENCES public.clients(client_id)\n    ON DELETE SET NULL;\n\n-- Add comments to new columns for clarity\nCOMMENT ON COLUMN public.leads.total_ai_costs IS 'Calculated: (ai_trainings_count * ai_training_cost_per_unit) + (ai_prompts_count * ai_prompt_cost_per_unit)';\nCOMMENT ON COLUMN public.leads.revenue_from_lead_usd IS 'Revenue converted to USD for consistent ROI calculation. Calculated: revenue_from_lead_local / exchange_rate_at_conversion';\nCOMMENT ON COLUMN public.leads.roi IS 'Calculated: (revenue_from_lead_usd - total_ai_costs) / total_ai_costs * 100. Handle division by zero.';\nCOMMENT ON COLUMN public.leads.client_id IS 'If lead is converted, this links to the corresponding client record.';"}	update_leads_table_schema_v2	avi@ai-master.co.il	\N
20250531085608	{"-- Lead Activity Log Table (lead_activity_log)\nCREATE TABLE IF NOT EXISTS public.lead_activity_log (\n    activity_id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n    lead_id UUID NOT NULL REFERENCES public.leads(lead_id) ON DELETE CASCADE,\n    activity_timestamp TIMESTAMPTZ DEFAULT NOW() NOT NULL,\n    activity_description TEXT NOT NULL,\n    user_id UUID REFERENCES auth.users(id) ON DELETE SET NULL -- Optional: link to user who performed action\n);\n\nCREATE INDEX IF NOT EXISTS idx_lead_activity_log_lead_id ON public.lead_activity_log(lead_id);\nCOMMENT ON TABLE public.lead_activity_log IS 'Stores a log of all activities related to a lead.';\n\n-- Lead Comments Table (lead_comments)\nCREATE TABLE IF NOT EXISTS public.lead_comments (\n    comment_id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n    lead_id UUID NOT NULL REFERENCES public.leads(lead_id) ON DELETE CASCADE,\n    comment_timestamp TIMESTAMPTZ DEFAULT NOW() NOT NULL,\n    comment_text TEXT NOT NULL,\n    user_id UUID REFERENCES auth.users(id) ON DELETE SET NULL -- Optional: link to user who added comment\n);\n\nCREATE INDEX IF NOT EXISTS idx_lead_comments_lead_id ON public.lead_comments(lead_id);\nCOMMENT ON TABLE public.lead_comments IS 'Stores comments and notes related to a lead.';\n\n-- AI Pricing Settings Table (ai_pricing_settings)\nCREATE TABLE IF NOT EXISTS public.ai_pricing_settings (\n    setting_id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n    setting_name TEXT NOT NULL UNIQUE, -- e.g., 'training_regular_cost', 'training_advanced_cost', 'training_premium_cost', 'default_prompt_cost', 'usd_to_local_currency_rate'\n    setting_value NUMERIC(10, 4) NOT NULL, -- Using 4 decimal places for rates or precise costs\n    description TEXT,\n    last_updated_by UUID REFERENCES auth.users(id) ON DELETE SET NULL,\n    updated_at TIMESTAMPTZ DEFAULT NOW() NOT NULL\n);\n\nCOMMENT ON TABLE public.ai_pricing_settings IS 'Stores global AI pricing configurations and exchange rates.';\n\n-- Populate ai_pricing_settings with initial default values\nINSERT INTO public.ai_pricing_settings (setting_name, setting_value, description) VALUES\n    ('training_regular_cost', 1.50, 'Default cost for a regular AI training unit'),\n    ('training_advanced_cost', 2.50, 'Default cost for an advanced AI training unit'),\n    ('training_premium_cost', 5.00, 'Default cost for a premium AI training unit'),\n    ('default_prompt_cost', 0.16, 'Default cost per AI prompt'),\n    ('usd_to_local_currency_rate', 3.70, 'Conversion rate from USD to local currency (e.g., ILS)')\nON CONFLICT (setting_name) DO NOTHING; -- Prevents error if settings already exist\n\n-- Trigger for updated_at on new tables\nCREATE OR REPLACE FUNCTION public.trigger_set_timestamp()\nRETURNS TRIGGER AS $$\nBEGIN\n  NEW.updated_at = NOW();\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Apply trigger to ai_pricing_settings\nDO $$\nBEGIN\n    IF NOT EXISTS (SELECT 1 FROM pg_trigger WHERE tgname = 'set_ai_pricing_settings_updated_at' AND tgrelid = 'public.ai_pricing_settings'::regclass) THEN\n        CREATE TRIGGER set_ai_pricing_settings_updated_at\n        BEFORE UPDATE ON public.ai_pricing_settings\n        FOR EACH ROW\n        EXECUTE FUNCTION public.trigger_set_timestamp();\n    END IF;\nEND $$;"}	create_supporting_lead_tables	avi@ai-master.co.il	\N
20250601074120	{"-- יצירת לידים עבור הגשות שלא מקושרות\n-- נטפל בהגשות שיש להן תמונות אבל אין פרטי קשר\n\nDO $$\nDECLARE\n    orphaned_submission RECORD;\n    new_lead_id UUID;\n    anonymous_restaurant_name TEXT;\n    anonymous_contact_name TEXT;\n    anonymous_email TEXT;\n    anonymous_phone TEXT;\n    processed_count INTEGER := 0;\nBEGIN\n    -- סופרים כמה הגשות לא מקושרות יש לנו\n    RAISE NOTICE 'Starting to process orphaned submissions...';\n    \n    -- עוברים על כל ההגשות הלא מקושרות\n    FOR orphaned_submission IN \n        SELECT submission_id, item_name_at_submission, item_type, uploaded_at, original_image_urls\n        FROM customer_submissions \n        WHERE client_id IS NULL AND created_lead_id IS NULL\n        ORDER BY uploaded_at DESC\n    LOOP\n        -- יוצרים פרטים אנונימיים\n        anonymous_restaurant_name := 'הגשה אנונימית - ' || orphaned_submission.item_name_at_submission;\n        anonymous_contact_name := 'משתמש אנונימי';\n        anonymous_email := 'anonymous+' || replace(orphaned_submission.submission_id::text, '-', '') || '@foodvision.demo';\n        anonymous_phone := '000-0000000'; -- טלפון אנונימי\n        \n        -- יוצרים ליד חדש עבור ההגשה הזו\n        INSERT INTO public.leads (\n            restaurant_name,\n            contact_name,\n            email,\n            phone,\n            lead_status,\n            lead_source,\n            notes,\n            next_follow_up_date,\n            created_at,\n            updated_at\n        ) VALUES (\n            anonymous_restaurant_name,\n            anonymous_contact_name,\n            anonymous_email,\n            anonymous_phone,\n            'ליד חדש'::lead_status_type,\n            'אתר'::lead_source_type, -- משתמשים ב\\"אתר\\" כמקור\n            'ליד שנוצר אוטומטית עבור הגשה אנונימית. פריט: ' || orphaned_submission.item_name_at_submission || ', סוג: ' || orphaned_submission.item_type || '. תאריך הגשה מקורי: ' || orphaned_submission.uploaded_at::text,\n            NOW() + INTERVAL '7 days',\n            orphaned_submission.uploaded_at, -- משתמשים בתאריך ההגשה המקורי\n            NOW()\n        ) RETURNING lead_id INTO new_lead_id;\n        \n        -- מקשרים את ההגשה לליד החדש\n        UPDATE customer_submissions \n        SET created_lead_id = new_lead_id\n        WHERE submission_id = orphaned_submission.submission_id;\n        \n        processed_count := processed_count + 1;\n        \n        IF processed_count % 5 = 0 THEN\n            RAISE NOTICE 'Processed % orphaned submissions so far...', processed_count;\n        END IF;\n    END LOOP;\n    \n    RAISE NOTICE 'Successfully processed % orphaned submissions and created leads for them.', processed_count;\nEND $$;"}	fix_orphaned_submissions_create_leads_v3	avi@ai-master.co.il	\N
20250601092010	{"-- Temporarily allow full access to leads table for authenticated users\n-- This will be replaced with proper admin checks later\n\n-- Drop existing restrictive policies\nDROP POLICY IF EXISTS \\"admin_full_access_leads\\" ON leads;\nDROP POLICY IF EXISTS \\"Admins have full access to leads\\" ON leads;\n\n-- Create a temporary policy that allows authenticated users to access leads\nCREATE POLICY \\"authenticated_full_access_leads_temp\\" ON leads\n  FOR ALL\n  TO authenticated\n  USING (true)\n  WITH CHECK (true);\n\n-- Comment for tracking: This is a temporary fix for the leads admin page\n-- TODO: Replace with proper admin role checking after fixing authentication\nCOMMENT ON POLICY \\"authenticated_full_access_leads_temp\\" ON leads IS \n  'Temporary policy allowing all authenticated users access to leads table. Should be replaced with proper admin role checking.';"}	temp_fix_leads_access	avi@ai-master.co.il	\N
20250601093303	{"-- Temporarily allow full access to customer_submissions table for authenticated users\n-- This will be replaced with proper admin checks later\n\n-- Drop existing restrictive policies if they exist\nDROP POLICY IF EXISTS \\"authenticated_full_access_customer_submissions_temp\\" ON customer_submissions;\n\n-- Create a temporary policy that allows authenticated users to access customer_submissions\nCREATE POLICY \\"authenticated_full_access_customer_submissions_temp\\" ON customer_submissions\n  FOR ALL\n  TO authenticated\n  USING (true)\n  WITH CHECK (true);\n\n-- Comment for tracking: This is a temporary fix for the submissions admin page\n-- TODO: Replace with proper admin role checking after fixing authentication\nCOMMENT ON POLICY \\"authenticated_full_access_customer_submissions_temp\\" ON customer_submissions IS \n  'Temporary policy allowing all authenticated users access to customer_submissions table. Should be replaced with proper admin role checking.';\n\n-- Also ensure that the clients table has proper temp access\nDROP POLICY IF EXISTS \\"authenticated_full_access_clients_temp\\" ON clients;\n\nCREATE POLICY \\"authenticated_full_access_clients_temp\\" ON clients\n  FOR ALL\n  TO authenticated\n  USING (true)\n  WITH CHECK (true);\n\nCOMMENT ON POLICY \\"authenticated_full_access_clients_temp\\" ON clients IS \n  'Temporary policy allowing all authenticated users access to clients table. Should be replaced with proper admin role checking.';"}	temp_fix_admin_access_all_tables	avi@ai-master.co.il	\N
20250601094009	{"-- Add temporary RLS policies for additional tables needed by admin interface\n\n-- Drop existing policies if they exist\nDROP POLICY IF EXISTS \\"authenticated_full_access_dishes_temp\\" ON dishes;\nDROP POLICY IF EXISTS \\"authenticated_full_access_cocktails_temp\\" ON cocktails;\nDROP POLICY IF EXISTS \\"authenticated_full_access_drinks_temp\\" ON drinks;\nDROP POLICY IF EXISTS \\"authenticated_full_access_service_packages_temp\\" ON service_packages;\n\n-- Create temporary policies for dishes table\nCREATE POLICY \\"authenticated_full_access_dishes_temp\\" ON dishes\n  FOR ALL\n  TO authenticated\n  USING (true)\n  WITH CHECK (true);\n\n-- Create temporary policies for cocktails table (if exists)\nDO $$\nBEGIN\n  IF EXISTS (SELECT FROM information_schema.tables WHERE table_name = 'cocktails' AND table_schema = 'public') THEN\n    EXECUTE 'CREATE POLICY \\"authenticated_full_access_cocktails_temp\\" ON cocktails\n      FOR ALL\n      TO authenticated\n      USING (true)\n      WITH CHECK (true)';\n  END IF;\nEND $$;\n\n-- Create temporary policies for drinks table (if exists)\nDO $$\nBEGIN\n  IF EXISTS (SELECT FROM information_schema.tables WHERE table_name = 'drinks' AND table_schema = 'public') THEN\n    EXECUTE 'CREATE POLICY \\"authenticated_full_access_drinks_temp\\" ON drinks\n      FOR ALL\n      TO authenticated\n      USING (true)\n      WITH CHECK (true)';\n  END IF;\nEND $$;\n\n-- Create temporary policies for service_packages table\nCREATE POLICY \\"authenticated_full_access_service_packages_temp\\" ON service_packages\n  FOR ALL\n  TO authenticated\n  USING (true)\n  WITH CHECK (true);\n\n-- Add comments for tracking\nCOMMENT ON POLICY \\"authenticated_full_access_dishes_temp\\" ON dishes IS \n  'Temporary policy allowing all authenticated users access. Should be replaced with proper admin role checking.';\n\nCOMMENT ON POLICY \\"authenticated_full_access_service_packages_temp\\" ON service_packages IS \n  'Temporary policy allowing all authenticated users access. Should be replaced with proper admin role checking.';"}	temp_fix_additional_admin_tables	avi@ai-master.co.il	\N
20250602112703	{"-- Enhanced Leads CRM Fields Migration v2\n-- This migration adds comprehensive CRM fields to support advanced lead management\n\n-- 1. Create business types tracking table\nCREATE TABLE IF NOT EXISTS business_types (\n    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n    type_name TEXT NOT NULL UNIQUE,\n    created_at TIMESTAMPTZ DEFAULT now(),\n    created_by UUID REFERENCES auth.users(id)\n);\n\n-- Insert default business types\nINSERT INTO business_types (type_name) VALUES \n    ('מסעדה'),\n    ('בית קפה'), \n    ('מאפייה'),\n    ('בר'),\n    ('מלון'),\n    ('פאב'),\n    ('אחר')\nON CONFLICT (type_name) DO NOTHING;\n\n-- 2. Add enhanced lead fields\nALTER TABLE leads \n    ADD COLUMN IF NOT EXISTS business_type TEXT DEFAULT 'מסעדה',\n    ADD COLUMN IF NOT EXISTS is_archived BOOLEAN DEFAULT FALSE,\n    ADD COLUMN IF NOT EXISTS lora_page_url TEXT,\n    ADD COLUMN IF NOT EXISTS style_description TEXT,\n    ADD COLUMN IF NOT EXISTS custom_prompt TEXT,\n    ADD COLUMN IF NOT EXISTS reminder_notes TEXT,\n    ADD COLUMN IF NOT EXISTS conversion_reason TEXT,\n    ADD COLUMN IF NOT EXISTS rejection_reason TEXT;\n\n-- 3. Add cost tracking fields with multiple AI training tiers\nALTER TABLE leads\n    ADD COLUMN IF NOT EXISTS ai_training_25_count INTEGER DEFAULT 0,\n    ADD COLUMN IF NOT EXISTS ai_training_15_count INTEGER DEFAULT 0,\n    ADD COLUMN IF NOT EXISTS ai_training_5_count INTEGER DEFAULT 0;"}	enhance_leads_crm_fields_v2	avi@ai-master.co.il	\N
20250602112836	{"-- Update computed columns and add relationships\n\n-- 1. Update the computed total_ai_costs column to include all training tiers\nALTER TABLE leads DROP COLUMN IF EXISTS total_ai_costs;\nALTER TABLE leads ADD COLUMN total_ai_costs NUMERIC GENERATED ALWAYS AS (\n    (ai_training_25_count * 2.5) + \n    (ai_training_15_count * 1.5) + \n    (ai_training_5_count * 5.0) + \n    (ai_prompts_count * ai_prompt_cost_per_unit)\n) STORED;\n\n-- 2. Create lead submissions relationship table (many-to-many)\nCREATE TABLE IF NOT EXISTS lead_submissions (\n    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n    lead_id UUID NOT NULL REFERENCES leads(lead_id) ON DELETE CASCADE,\n    submission_id UUID NOT NULL REFERENCES customer_submissions(submission_id) ON DELETE CASCADE,\n    created_at TIMESTAMPTZ DEFAULT now(),\n    UNIQUE(lead_id, submission_id)\n);\n\n-- 3. Create enhanced reminders table\nCREATE TABLE IF NOT EXISTS lead_reminders (\n    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n    lead_id UUID NOT NULL REFERENCES leads(lead_id) ON DELETE CASCADE,\n    reminder_date TIMESTAMPTZ NOT NULL,\n    reminder_type TEXT DEFAULT 'follow_up',\n    title TEXT NOT NULL,\n    description TEXT,\n    is_completed BOOLEAN DEFAULT FALSE,\n    completed_at TIMESTAMPTZ,\n    created_by UUID REFERENCES auth.users(id),\n    created_at TIMESTAMPTZ DEFAULT now()\n);\n\n-- 4. Add indexes for performance\nCREATE INDEX IF NOT EXISTS idx_leads_business_type ON leads(business_type);\nCREATE INDEX IF NOT EXISTS idx_leads_is_archived ON leads(is_archived);\nCREATE INDEX IF NOT EXISTS idx_lead_reminders_date ON lead_reminders(reminder_date) WHERE NOT is_completed;\nCREATE INDEX IF NOT EXISTS idx_lead_submissions_lead_id ON lead_submissions(lead_id);"}	enhance_leads_crm_computed_fields	avi@ai-master.co.il	\N
20250602112916	{"-- Add RLS policies and utility functions\n\n-- 1. Enable RLS for new tables\nALTER TABLE business_types ENABLE ROW LEVEL SECURITY;\nALTER TABLE lead_submissions ENABLE ROW LEVEL SECURITY;\nALTER TABLE lead_reminders ENABLE ROW LEVEL SECURITY;\n\n-- 2. Allow authenticated users to read business types\nCREATE POLICY \\"Allow authenticated users to read business types\\" ON business_types\n    FOR SELECT TO authenticated USING (true);\n\n-- 3. Allow admins to manage business types\nCREATE POLICY \\"Allow admins to manage business types\\" ON business_types\n    FOR ALL TO authenticated USING (\n        EXISTS (\n            SELECT 1 FROM user_roles \n            WHERE user_id = auth.uid() AND role = 'admin'\n        )\n    );\n\n-- 4. Temporary policies for lead_submissions and lead_reminders\nCREATE POLICY \\"authenticated_full_access_lead_submissions_temp\\" ON lead_submissions\n    FOR ALL TO authenticated USING (true) WITH CHECK (true);\n\nCREATE POLICY \\"authenticated_full_access_lead_reminders_temp\\" ON lead_reminders\n    FOR ALL TO authenticated USING (true) WITH CHECK (true);\n\n-- 5. Create function to add new business type dynamically\nCREATE OR REPLACE FUNCTION add_business_type(type_name TEXT)\nRETURNS UUID\nLANGUAGE plpgsql\nSECURITY DEFINER\nAS $$\nDECLARE\n    new_id UUID;\nBEGIN\n    INSERT INTO business_types (type_name, created_by)\n    VALUES (type_name, auth.uid())\n    ON CONFLICT (type_name) DO NOTHING\n    RETURNING id INTO new_id;\n    \n    -- If conflict occurred, get existing id\n    IF new_id IS NULL THEN\n        SELECT id INTO new_id FROM business_types WHERE business_types.type_name = add_business_type.type_name;\n    END IF;\n    \n    RETURN new_id;\nEND;\n$$;\n\n-- 6. Create function to get all business types\nCREATE OR REPLACE FUNCTION get_business_types()\nRETURNS TABLE(id UUID, type_name TEXT, created_at TIMESTAMPTZ)\nLANGUAGE plpgsql\nSECURITY DEFINER\nAS $$\nBEGIN\n    RETURN QUERY\n    SELECT bt.id, bt.type_name, bt.created_at\n    FROM business_types bt\n    ORDER BY bt.type_name;\nEND;\n$$;"}	enhance_leads_rls_and_functions	avi@ai-master.co.il	\N
20250602112940	{"-- Add new lead source values\nALTER TYPE lead_source_type ADD VALUE 'קמפיין';\nALTER TYPE lead_source_type ADD VALUE 'טלמרקטינג';"}	add_new_lead_sources	avi@ai-master.co.il	\N
20250602123226	{"-- Add archived_at column to leads table\nALTER TABLE leads ADD COLUMN IF NOT EXISTS archived_at timestamp with time zone NULL;\n\n-- Create convert_lead_to_client function\nCREATE OR REPLACE FUNCTION public.convert_lead_to_client(p_lead_id uuid)\nRETURNS uuid AS $$\nDECLARE\n  lead_record leads%ROWTYPE;\n  new_client_id uuid;\nBEGIN\n  -- Get the lead record\n  SELECT * INTO lead_record FROM leads WHERE lead_id = p_lead_id;\n  \n  IF NOT FOUND THEN\n    RAISE EXCEPTION 'Lead not found with ID: %', p_lead_id;\n  END IF;\n  \n  -- Create new client record\n  INSERT INTO clients (\n    restaurant_name,\n    contact_name,\n    phone,\n    email,\n    original_lead_id,\n    client_status\n  ) VALUES (\n    lead_record.restaurant_name,\n    lead_record.contact_name,\n    lead_record.phone,\n    lead_record.email,\n    p_lead_id,\n    'פעיל'\n  ) RETURNING client_id INTO new_client_id;\n  \n  -- Update lead status and link to client\n  UPDATE leads \n  SET \n    lead_status = 'הפך ללקוח',\n    client_id = new_client_id,\n    updated_at = now()\n  WHERE lead_id = p_lead_id;\n  \n  -- Log the activity\n  INSERT INTO lead_activity_log (lead_id, activity_description)\n  VALUES (p_lead_id, 'הליד הומר ללקוח');\n  \n  RETURN new_client_id;\nEND;\n$$ LANGUAGE plpgsql;"}	fix_leads_archive_and_functions	avi@ai-master.co.il	\N
20250602015450	{"-- Fix the trigger function to use the correct column name\nCREATE OR REPLACE FUNCTION public.update_lead_modified_column()\nRETURNS trigger\nLANGUAGE plpgsql\nAS $function$\nBEGIN\n   NEW.updated_at = now();\n   RETURN NEW;\nEND;\n$function$;"}	fix_leads_trigger_function	avi@ai-master.co.il	\N
20241220000000	{"-- Enhanced Submission Management System\n-- Add new fields to customer_submissions table for comprehensive submission management\n\nBEGIN","-- Add new fields to customer_submissions table\nALTER TABLE public.customer_submissions \nADD COLUMN IF NOT EXISTS lora_link TEXT,\nADD COLUMN IF NOT EXISTS lora_name TEXT,\nADD COLUMN IF NOT EXISTS fixed_prompt TEXT,\nADD COLUMN IF NOT EXISTS created_lead_id UUID REFERENCES public.leads(lead_id) ON DELETE SET NULL","-- Create submission_comments table for advanced comment system\nCREATE TABLE IF NOT EXISTS public.submission_comments (\n  comment_id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n  submission_id UUID NOT NULL REFERENCES public.customer_submissions(submission_id) ON DELETE CASCADE,\n  comment_type TEXT NOT NULL CHECK (comment_type IN ('admin_internal', 'client_visible', 'editor_note')),\n  comment_text TEXT NOT NULL,\n  tagged_users UUID[],\n  visibility TEXT NOT NULL DEFAULT 'admin' CHECK (visibility IN ('private', 'client', 'editor', 'admin', 'all')),\n  created_by UUID REFERENCES auth.users(id) ON DELETE SET NULL,\n  created_at TIMESTAMPTZ DEFAULT NOW() NOT NULL,\n  updated_at TIMESTAMPTZ DEFAULT NOW() NOT NULL\n)","-- Create indexes for performance\nCREATE INDEX IF NOT EXISTS idx_submission_comments_submission_id ON public.submission_comments(submission_id)","CREATE INDEX IF NOT EXISTS idx_submission_comments_created_by ON public.submission_comments(created_by)","CREATE INDEX IF NOT EXISTS idx_submission_comments_comment_type ON public.submission_comments(comment_type)","CREATE INDEX IF NOT EXISTS idx_customer_submissions_created_lead_id ON public.customer_submissions(created_lead_id)","-- Create trigger for updated_at on submission_comments\nCREATE OR REPLACE FUNCTION public.trigger_set_timestamp()\nRETURNS TRIGGER AS $$\nBEGIN\n  NEW.updated_at = NOW();\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql","-- Create trigger for submission_comments\nCREATE TRIGGER IF NOT EXISTS set_submission_comments_updated_at\nBEFORE UPDATE ON public.submission_comments\nFOR EACH ROW\nEXECUTE FUNCTION public.trigger_set_timestamp()","-- Add comments to explain the new fields\nCOMMENT ON COLUMN public.customer_submissions.lora_link IS 'URL link to the LoRA model used for this submission'","COMMENT ON COLUMN public.customer_submissions.lora_name IS 'Descriptive name of the LoRA model'","COMMENT ON COLUMN public.customer_submissions.fixed_prompt IS 'Custom AI prompt used specifically for this submission'","COMMENT ON COLUMN public.customer_submissions.created_lead_id IS 'Reference to the lead that was created from this submission (if applicable)'","COMMENT ON TABLE public.submission_comments IS 'Comments system for submissions with different visibility levels'","COMMENT ON COLUMN public.submission_comments.comment_type IS 'Type of comment: admin_internal (admin only), client_visible (client can see), editor_note (editor specific)'","COMMENT ON COLUMN public.submission_comments.tagged_users IS 'Array of user IDs that are tagged in this comment'","COMMENT ON COLUMN public.submission_comments.visibility IS 'Who can see this comment: private, client, editor, admin, all'","-- RLS Policies for submission_comments\nALTER TABLE public.submission_comments ENABLE ROW LEVEL SECURITY","-- Admin can see all comments\nCREATE POLICY \\"admin_full_access_submission_comments\\"\nON public.submission_comments\nFOR ALL\nTO authenticated\nUSING (public.is_admin())\nWITH CHECK (public.is_admin())","-- Editors can see editor and admin comments, and create editor comments\nCREATE POLICY \\"editor_access_submission_comments\\"\nON public.submission_comments\nFOR SELECT\nTO authenticated\nUSING (\n  public.is_editor() AND \n  (comment_type IN ('editor_note', 'admin_internal') OR visibility IN ('editor', 'all'))\n)","CREATE POLICY \\"editor_create_submission_comments\\"\nON public.submission_comments\nFOR INSERT\nTO authenticated\nWITH CHECK (\n  public.is_editor() AND \n  comment_type = 'editor_note'\n)","-- Clients can see client_visible comments for their submissions\nCREATE POLICY \\"client_view_submission_comments\\"\nON public.submission_comments\nFOR SELECT\nTO authenticated\nUSING (\n  comment_type = 'client_visible' AND\n  submission_id IN (\n    SELECT submission_id \n    FROM public.customer_submissions \n    WHERE client_id IN (\n      SELECT client_id \n      FROM public.clients \n      WHERE user_auth_id = auth.uid()\n    )\n  )\n)","-- Grant necessary permissions\nGRANT SELECT, INSERT, UPDATE, DELETE ON public.submission_comments TO authenticated","GRANT USAGE ON SCHEMA public TO authenticated",COMMIT}	enhanced_submission_management	\N	\N
